Tetris 4000

Tetris4000 will surprise you with wonderful 3D effects: oscillating blocks, moving interactive frames, a nice 3D gameplay. Also you will enjoy unusual bonuses such as the bomb that blows up several lines of blocks, rotating bonuses, special figures and others. Try all of the numerous game options, including light popular music and stereo sound effects. Compete with the world to see your name in the High Score List in the Internet. 
